    strongest = max(extensions, key=lambda x: extension_strength(x))

    return f"{class_name}.{strongest}"

def cycpattern_check(a, b):
    if len(a) != len(b):
        return False
    return b in a + a

def even_odd_count(num):
    even_count = len([int(x) for x in str(num) if int(x) % 2 == 0])
    odd_count = len([int(x) for x in str(num) if int(x) % 2 != 0])
    return (even_count, odd_count)

def int_to_mini_roman(number):
    roman_dict = {1: 'i', 4: 'iv', 5: 'v', 9: 'ix', 10: 'x', 40: 'xl', 50: 'l', 90: 'xc', 
                  100: 'c', 400: 'cd', 500: 'd', 900: 'cm', 1000: 'm'}
    result = ''
    for key in sorted(roman_dict.keys(), reverse=True):
        while number >= key:
            result += roman_dict[key]
            number -= key
    return result.lower()

def do_algebra(operators, operands):
    expression = str(operands[0])
    for i in range(1, len(operands)):
        expression += operators[i-1] + str(operands[i])
    return eval(expression)

import hashlib

def string_to_md5(text):
    if text == "":
        return None
    else:
        return hashlib.md5(text.encode()).hexdigest()
